import React, { useEffect, useState } from "react";
import { getData, decodeToken, getAuthToken } from "../api/endpoint";
import "./PatientDashboard.css"; // pour le style

const PatientDashboard = () => {
  const [dossiers, setDossiers] = useState([]);
  const [rendezvous, setRendezvous] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const decodedToken = decodeToken(getAuthToken());
  const patientId = decodedToken?._id;

  const loadPatientData = async () => {
    setLoading(true);
    setError(null);
    try {
      // dossiers
      const dossiersData = await getData("/mes-dossiers");
      setDossiers(dossiersData);

      // rendezvous
      const rdvData = await getData(`/rendezvous?patientId=${patientId}`);
      setRendezvous(rdvData);
    } catch (err) {
      console.error("Erreur chargement patient :", err);
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    loadPatientData();
  }, []);

  if (loading) return <p>Chargement des données...</p>;
  if (error) return <p className="text-red-600">Erreur : {error}</p>;

  return (
    <div className="patient-dashboard p-4">
      <h2>Bienvenue {decodedToken?.fullName || "Patient"}</h2>

      <button onClick={loadPatientData} className="btn-refresh mb-4">
        Rafraîchir
      </button>

      <section className="dossiers-section mb-6">
        <h3>Mes Dossiers Médicaux</h3>
        {dossiers.length === 0 ? (
          <p>Aucun dossier trouvé.</p>
        ) : (
          <table className="table">
            <thead>
              <tr>
                <th>ID</th>
                <th>Nom complet</th>
                <th>Date de naissance</th>
                <th>Sexe</th>
                <th>Statut</th>
              </tr>
            </thead>
            <tbody>
              {dossiers.map((dossier) => (
                <tr key={dossier._id}>
                  <td>{dossier._id}</td>
                  <td>{dossier.patientName || "–"}</td>
                  <td>{dossier.date_of_birth?.split("T")[0]}</td>
                  <td>{dossier.sexe}</td>
                  <td>{dossier.statut}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </section>

      <section className="rendezvous-section">
        <h3>Mes Rendez-Vous</h3>
        {rendezvous.length === 0 ? (
          <p>Aucun rendez-vous prévu.</p>
        ) : (
          <table className="table">
            <thead>
              <tr>
                <th>ID</th>
                <th>Date</th>
                <th>Heure</th>
                <th>Service</th>
                <th>Statut</th>
              </tr>
            </thead>
            <tbody>
              {rendezvous.map((rdv) => (
                <tr key={rdv._id}>
                  <td>{rdv._id}</td>
                  <td>{rdv.date?.split("T")[0]}</td>
                  <td>{rdv.time}</td>
                  <td>{rdv.serviceName}</td>
                  <td>{rdv.status}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </section>
    </div>
  );
};

export default PatientDashboard;
